import React from 'react';
import classes from './addressSavedCard.module.css';

function AddressSavedCard(props){
    return(
        <div className={classes.layout}>
            <p>Name</p>
            <p>House</p>
            <p>Town</p>
            <p>City State Pin</p>
        </div>
    );
}

export default AddressSavedCard;
